28	\N	\N	2021-04-13 08:13:49.881	2022-01-14 08:14:03.567	https://www.isric.org/explore/soilgrids	ISRIC — World Soil Information	\N	SoilGrids250m 2.0	2020-05-01	2020-05-01	\N	\N	\N	2070	f	\N	\N	GEOREFERENCED	16453	SoilGridsTM (hereafter SoilGrids) is a system for global digital soil mapping that uses state-of-the-art machine learning methods to map the spatial distribution of soil properties across the globe. SoilGrids prediction models are fitted using over 230 000 soil profile observations from the WoSIS database and a series of environmental covariates. Covariates were selected from a pool of over 400 environmental layers from Earth observation derived products and other environmental information including climate, land cover and terrain morphology. The outputs of SoilGrids are global soil property maps at six standard depth intervals (according to the GlobalSoilMap IUSS working group and its specifications) at a spatial resolution of 250 meters.	250	\N	17218	\N	2020-05-01
