456	\N	\N	2021-12-13 09:43:53.253	2022-01-13 09:44:52.832	https://www.eea.europa.eu/data-and-maps/data/annual-start-of-vegetation-growing	European Environment Agency	\N	Start of vegetation growing season 2000-2016	2000-01-01	2016-12-01	\N	\N	\N	2070	f	\N	17	GEOREFERENCED	16453	The raster files are the time series of the start of the vegetation growing season (day of the year) and the derived linear trends (in day / year). The start of the growing season time-series is based on the time series of the Plant Phenology Index (PPI) derived from the MODIS BRDF-Adjusted Reflectance product (MODIS MCD43 NBAR). The PPI index is optimized for efficient monitoring of vegetation phenology and is derived from the source MODIS data using radiative transfer solutions applied to the reflectance in visible-red and near infrared spectral domains. The start of season indicator is based on calculating the start of the vegetation growing season from the annual PPI temporal curve using the TIMESAT software for each year between and including 2000 and 2016.	500	Annual	17218	2019-03-12	2021-05-17
