80	\N	\N	2021-10-18 07:34:01.707	2022-01-10 13:42:01.566	https://ec.europa.eu/eurostat/databrowser/view/tai09/default/table?lang=en	EUROSTAT	\N	    EUROSTAT - Livestock density index	2005-01-01	2016-12-01	\N	\N	\N	2070	f	\N	5	SOCIOECONOMIC	16452	The livestock density index provides the number of livestock units (LSU) per hectare of utilised agricultural area. The LSU is a reference unit which facilitates the aggregation of livestock from various species and ages. The Eurofarm LSU coefficients, which are at the basis of this indicator, are established by convention (originally, they were related to the animals' feed requirements, the reference being a dairy cow with an annual yield of 3000 kg milk, without additional concentrated feedingstuffs). In the interpretation of the livestock density index, the limits of this theoretical unit are to be taken into account. The livestock species aggregated in the LSU total, for the purpose of this indicator, are: equidae, cattle, sheep, goats, pigs, poultry and rabbits.	\N	Annual	17218	\N	2021-02-22
