106	\N	\N	2021-10-20 14:14:55.215	2022-01-10 14:02:43.128	https://ec.europa.eu/eurostat/databrowser/view/tag00025/default/table?lang=en	EUROSTAT	\N	EUROSTAT - Utilised agricultural area by categories	2009-01-01	2020-12-01	\N	\N	\N	2056	f	\N	5	SOCIOECONOMIC	16452	The Utilised agricultural area (abbreviated as UAA) describes the area used for farming. It includes the following land categories: •arable land; •permanent grassland; •permanent crops; •other agricultural land such as kitchen gardens (even if they only represent small areas of total UAA). The term does not include unused agricultural land, woodland and land occupied by buildings, farmyards, tracks, ponds, etc. This indicator uses the concept of "main area" that means the area of the land parcel: •in case of annual crops, the main area correspond to the sown area; •in the case of permanent crops, to the total planted area; •in the case of successive crops, to the main crop that occupied the parcel during that year; •and in the case of simultaneous crops, to the corresponding area of the different crops.	\N	Annual	17218	\N	2021-10-19
